    <div class="row">
        <div class="column">

            <img src={image2}/>
            <img src={image3}/>
            <img src={image4}/>
            <img src="nature.jpg"/>
            <img src="mist.jpg"/>
            <img src="paris.jpg"/>
        </div>
        <div class="column">

            <img src={image2}/>
            <img src={image3}/>
            <img src={image4}/>
        </div>
        <div class="column">

            <img src={image2}/>
            <img src={image3}/>
            <img src={image4}/>
        </div>
        <div class="column">

            <img src={image2}/>
            <img src={image3}/>
            <img src={image4}/>
        </div>
    </div>

  );
}
export default ContentCreation;
